import React from 'react'
import {useHistory} from 'react-router-dom'
function SeccionCaducada() {
    const history =useHistory()
    function clear(e){
        e.preventDefault()
        localStorage.clear('Token')
        history.push('/login')
    }
  return (
    <div className="-ml-2 pr-4 -mt-4 w-10/12 h-5/6 flex absolute  overflow-hidden ">
      <div className=" bg-white my-auto  mx-auto opacity-100  overflow-hidden h-auto ">
        <div className="bg-blue-primary flex flex-row justify-between text-white p-3">
          <h3 className="self-end">Session Caducada</h3>
        </div>
        <div>La Session ha caducado vuelva a Ingresas las Credenciales para Continuar</div>
        <button onClick={()=>clear}></button>
      </div>
    </div>
  )
}

export default SeccionCaducada
